  const [item, setItem] = new useState([]);
  const [temp, setTemp] = new useState();

  function update() {
    setItem([...item, temp]);

  }

  function updatetemp(e) {
    setTemp(e.target.value);
    setemo
  }

  const render = item.map( (i)=> <li>{i}</li> )


  return (
    <div className="App">
      <div className="card">
        <div className="title">
          <h1>TO DO LIST </h1>
        </div>

        <div className="additem">
          <input
            className="input"
            type="text"
            placeholder="Add items from here"
            onChange={updatetemp}
            value={temp}
          />
          <button onClick={update}> + </button>
        </div>

        <div className="list">
          <ol>{render}</ol>
        </div>

      </div>
    </div>
  );
}
export default App;
